import React from 'react'
import { Card } from 'react-bootstrap'
import products from '../products'
const Product = () => {
  return (
    <Card className="my-3 p-3 rounded">
      <a href={'/product/${products.id}'}></a>
    </Card>
  )
}

export default Product
